import { useEffect, useRef } from 'react'
import logoS from  '../../../assets/images/logo.svg';
import './index.scss';
import DrawSVGPlugin from 'gsap-trial/DrawSVGPlugin'
import gsap from 'gsap-trial'


const Logo = () => {

    const bgRef = useRef();
    const outlineLogoRef = useRef();
    const solidLogoRef = useRef();

    useEffect(() => {
        gsap.registerPlugin(DrawSVGPlugin)
    
        gsap
          .timeline()
          .to(bgRef.current, {
            duration: 1,
            opacity: 1,
          })
       
      }, [])
    

    return (
        <div className='logo-container'>
            <img className='solid-logo' src={logoS} alt='logo AM'/>
            <svg width="297"
                height="297"
                viewBox="0 0 297 297"
                fill="none"
                xmlns="http://www.w3.org/2000/svg">
                <g className='svg-container'  >
                <path d="M42 237.217L93.86 178.217L120.58 210.287L120.28 210.617L49.5 296.807H0C0 294.637 0 292.457 0 290.277C0 193.523 0 96.7732 0 0.026574L38.5 0.0269325C38.5 0.0269325 57.43 -0.0334259 57.5 0.026574C61.09 3.64657 79.2 26.9066 79.2 26.9066L149.86 115.747L244 0.026574H296.77L149.48 176.287L44.81 51.7266C44.7623 51.6736 44.6996 51.6365 44.6302 51.6202C44.5608 51.6038 44.4881 51.609 44.4218 51.6351C44.3555 51.6612 44.2987 51.7069 44.2591 51.7662C44.2194 51.8254 44.1988 51.8953 44.2 51.9666L42 237.217Z" fill="none" />
                <path d="M296.74 65.9993L297 296.999H254.5C254.56 258.126 254.223 219.607 254.29 180.747L156.5 296.999H107L254.3 118.007L296.74 65.9993Z" fill="none" />
                </g>
            </svg>
        </div>
    );
};

export default Logo;
